import React from "react";
import CheckBox from "./CheckBox";
const Tasks = props => {
    const [list, setList] = props;
    const checkbox = list.map(item => {
        <CheckBox key={item.id} data={item}/>
    })

    return (
        <div>
            Tasks
            <CheckBox/>
        </div>
    )
}

export default Tasks;
